            className='navbar-title'
            onClick={closeMobileMenu}
            onMouseEnter={() => setIsHoverHome(true)}
            onMouseLeave={() => setIsHoverHome(false)}
        >
            <img
            src='../../images/logo.png'
            alt=''
            className='navbar-logo'
            />
            {<>Anrim Jewelry</>}
        </Link>
        </nav>
    );
};

export default Navbar;
